import { getAll } from "../../utils/auth";
const isAdminReducer = (state = { isAdmin: getAll }, action) => {
  switch (action.type) {
    case "isAdmin":
      return {
        isAdmin: state.isAdmin,
      };

    default:
      return state;
  }
};

export default isAdminReducer;
